import React from "react"


export default function Placefinder(){
    var axios = require('axios')

    var config = {
        method: 'get',
        url: 'https://maps.googleapis.com/maps/api/place/nearbysearch/json?location=-33.8670522%2C151.1957362&radius=1500&type=restaurant&key=AIzaSyCpW-OtWMUTN3yozYKIyQ0UlUquxjGER9w',
        headers: {

        }
    }
    axios(config)
    .then(function (response) {
        console.log(JSON.stringify(response.data))
    })
    .catch(function (error) {
        console.log(error)
    })

}
